import React from "react";
import axios from 'axios';
import CategoryContainer from "../../components/home/categories/container/categoryContainer";
import PostsContainer from "../../components/home/posts/container/postsContainer";
import "./home.css";

export default function Homepage(){
    function getPosts(){
        axios.post('http://localhost:9000/getPosts', {
                username: localStorage.getItem('username')
            })
            .catch((err)=>{
                console.log(err);
            });
    }
    return(
        <div className="homepage">
            <CategoryContainer/>
            <PostsContainer/>
        </div>
    );
}
